import React from "react";
import { TwitterTweetEmbed } from "react-twitter-embed";

function Twitter({tweetId}) {
    return (
      <TwitterTweetEmbed tweetId={tweetId} options={{theme: 'dark' }}/>
    );
}

export default Twitter;
